function App() {
  return (
   <div className="grid-container">
     <header className="row">
       <div>
         <a className="brand" href="/">
           Nateur
         </a>
       </div>
       <div>
         <a href="/cart">Cart</a>
         <a href="/signin">Sign In</a>
       </div>
     </header>
     <footer className="row center">All right reserved</footer>
   </div>
  );
}

export default App;
